import React, { useState } from "react";
import {
  Container,
  Row,
  Col,
  Card,
  CardHeader,
  ListGroup,
  ListGroupItem,
  Form,
  Alert
} from "shards-react";

import Forms from "../components/components-overview/Forms";
import PageTitle from "../components/common/PageTitle";
import FormValidation from "../components/components-overview/FormValidation";


import "./Login.css";

export default function Login(props) {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  function validateForm() {
    return email.length > 0 && password.length > 0;
  }

  function handleSubmit(event) {
    event.preventDefault();
  }

  return (
    <div className="Login">
        <Alert className="mb-0">
          <i className="fa fa-info mx-2"></i> How you doin'? I'm just a friendly, good-looking notification message and I come in all the colors you can see below. Pretty cool, huh?
        </Alert>

    <Container fluid className="main-content-container px-4">
      <Row noGutters className="page-header py-4">
        <PageTitle
          sm="4"
          title="Login & Create List For Spotify"
          subtitle="Overview"
          className="text-sm-left"
        />
      </Row>

      <Row>
        <Col lg="8" className="mb-4">
          <Card small className="mb-4">
            <CardHeader className="border-bottom">
              <h6 className="m-0">Login Page</h6>
            </CardHeader>
              <ListGroup flush>
               <ListGroupItem className="p-3">
                <Row>
                  <FormValidation />
                </Row>
                </ListGroupItem>
            </ListGroup>
            </Card>
          </Col>
        </Row>
      </Container>

    </div>
  );
}
